import ReactDOM from 'react-dom';

import Nav from '../Nav/Nav';
import Footer from '../Footer/Footer';
import Header from '../Header/Header';

export default function Friends() {
    return (
        <div id="friends">
            <Header />
            <Nav />
            <Footer />
        </div>
    );
}
